    for i in range(N):
        for j in range(N):
            if grid[i][j] == '<':
                if visited[i][j] == False:
                    visited[i][j] = True
                    if i > 0:
                        visited[i][j] = visited[i - 1][j] and visited[i][j]
                    if j > 0:
                        visited[i][j] = visited[i][j - 1] and visited[i][j]
                    if i < N - 1:
                        visited[i][j] = visited[i + 1][j] and visited[i][j]
                    if j < N - 1:
                        visited[i][j] = visited[i][j + 1] and visited[i][j]
    return ''.join(['1' if visited[i][j] else '0' for i in range(N) for j in range(N)])

