        if i == j:
            return floorplan[i]

        if floorplan[i][j] == '.':
            floorplan[i][j] = 'V'
            return rotate(floorplan, i+1, j)

        if floorplan[i][j] == 'V':
            floorplan[i][j] = 'H'
            return rotate(floorplan, i+1, j+1)

        if floorplan[i][j] == 'H':
            floorplan[i][j] = 'V'
