        if floorplan[i][j] == '.':
            floorplan[i][j] = '.'
            return rotate(floorplan, i+1, j+1)

        return floorplan[i][j]

    for i in range(n):
        for j in range(m):
            floorplan[i][j] = rotate(floorplan, i, j)

    return ''.join(floorplan[0])

