class Solution:
    def maxPoints(self, points: List[List[int]]) -> int:

        def dfs(i, j):
            if i == j:
                return 0

            if i == j:
                return 1

            if points[i][0] == points[j][0]:
                return dfs(i, j-1) + dfs(i+1, j)

            return max(dfs(i+1, j), dfs(i, j-1))

        return max(dfs(0, len(points)-1), dfs(0, 0))

